import React from 'react'
import AChart from "react-apexcharts";
import { connect } from 'react-redux'
import { postSeeds } from '../../actions/postSeeds'

const Seeds= ({todos, options}) =>{
    let a= 0;
    const todoList = todos.length ? (
        todos.map( (todo, index) => {
            let option = Object.assign(options, {chart: {...options.chart,id:'chart-'.concat(a)}});
            option.chart.id ='chart-'.concat(index);
            option.title.text = todos[a].name;
            return(
                <div className="col s6" key={a}>
                    <div className="card">
                        <AChart
                        options={option}
                        series={[todo]}/>
                    </div>
                </div>
            );
        }
        )
    ) : (
        <p className="center">Loading</p>
    );
    return(
        <div className="container">
            <div className="row">
                {todoList}
            </div>
        </div>
    );
}

const mapStateToProps = (state) => {
    return {
    data: state.seeds
    }
}

const mapDispatchToProps = (dispatch) => {
    return {
    postSeeds: (seeds) => {
        dispatch(postSeeds(seeds))
        return Promise.resolve()
    }
    }
}

export default connect(mapStateToProps, mapDispatchToProps)(Seeds);
